import React from 'react';
import { Link } from 'react-router-dom';

const NavigationMenu = () => {
  return (
    <nav style={{ marginBottom: '20px' }}>
      <Link to="/dashboard" style={{ margin: '0 10px' }}>Dashboard</Link>
      <Link to="/add-student" style={{ margin: '0 10px' }}>Add/Manage Student</Link>
      <Link to="/manage-vaccination" style={{ margin: '0 10px' }}>Manage Vaccination</Link>
      <Link to="/generate-report" style={{ margin: '0 10px' }}>Generate Report</Link>
    </nav>
  );
};

export default NavigationMenu;
